import React from "react";
import { Link} from "react-router-dom";
import "./dashboard.css";

const Dashboard = () => {
  return (
    <div className="main">
        <div className="dashbaord">
      <h1>Dashboard</h1>
</div>

      <ul>
        <li>
          <Link to="/dashboard/chat">Chat System</Link>
        </li>
        <li>
          <Link to="/dashboard/achievements">Track Achievements</Link>
        </li>
        <li>
          <Link to="/dashboard/progress">View Progress Report</Link>
        </li>
      </ul>
    </div>
  );
};

export default Dashboard;
